import React, { useState } from "react";
import "../styles/Carte.css";

const carte = () => {

    const [cardAnimaux, setCardAnimaux] = useState([]);

    const cardanimaux = () => {
        axios
        .get(`http://localhost:${import.meta.env.VITE_PORT_BACK}/animaux`)
        .then((res) => {
          setCardAnimaux(res.data);
        })
        .catch((err) => {
          console.error(err);
        });
    };
    return (
        <div className='carte'>
            <div className='cadre'>

            </div>
            carte
        </div>
    );
};

export default carte;
